import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";
import Menu from "@material-ui/core/Menu";
import MenuItem from "@material-ui/core/MenuItem";
import React from "react";

const Navigation = () => {
  const [anchorEl, setAnchorEl, anchorEl2, setAnchorEl2] = React.useState(null);

  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

  const handleClick2 = (event) => {
    setAnchorEl2(event.currentTarget);
  };

  const handleClose2 = () => {
    setAnchorEl2(null);
  };


  return (
    <div>
      <div className="navBar">
        <div className="searchLogo">
          <a href="#">
            <img
              src="https://res.cloudinary.com/robcg1102/image/upload/v1604355701/maq_img/logo_nqvtbv.png"
              alt="logo"
            />
          </a>

          <TextField id="standard-basic" label="Buscar producto..." />
        </div>

        <div className="options">
          <div className="optionMenu">
            <a href="#">
              <i class="ri-user-3-fill"></i>
              <p>Mi cuenta</p>
            </a>
          </div>
          <div className="optionMenu">
            <a href="#">
              <i class="ri-heart-fill"></i>
              <p>Mis favoritos</p>
            </a>
          </div>
          <div className="optionMenu">
            <a href="#">
              <i class="ri-upload-fill"></i>
              <p>Cargar pedido masivo</p>
            </a>
          </div>
          <div className="optionMenu">
            <a href="#">
              <i class="ri-shopping-cart-2-fill"></i>
              <p>Mi carrito</p>
            </a>
          </div>
        </div>
      </div>
      <div class="barDrop">
        <div className="menuDrop">
          <div>
            <Button
              aria-controls="simple-menu"
              aria-haspopup="true"
              onClick={handleClick}
              style={{ color: "white" }}
            >
              Departamentos
              <i class="ri-arrow-drop-down-line" style={{ color: "white" }}></i>
            </Button>
             <Menu
                id="simple-menu"
                anchorEl={anchorEl}
                keepMounted
                open={Boolean(anchorEl)}
                onClose={handleClose}
              >
                <MenuItem onClick={handleClose}>Profile</MenuItem>
                <MenuItem onClick={handleClose}>My account</MenuItem>
                <MenuItem onClick={handleClose}>Logout</MenuItem>
              </Menu>
          </div>
          <div>
            <Button
              aria-controls="simple-menu2"
              aria-haspopup="true"
              onClick={handleClick2}
              style={{ color: "white" }}
            >
              Marcas
              <i class="ri-arrow-drop-down-line" style={{ color: "white" }}></i>
            </Button>
            <Menu
              id="simple-menu2"
              anchorEl2={anchorEl2}
              keepMounted
              open={Boolean(anchorEl2)}
              onClose={handleClose2}
            >
              <MenuItem onClick={handleClose2}>Coflex</MenuItem>
              <MenuItem onClick={handleClose2}>Phillips</MenuItem>
              <MenuItem onClick={handleClose2}>Steren</MenuItem>
              <MenuItem onClick={handleClose2}>Teka</MenuItem>
              <MenuItem onClick={handleClose2}>Truper</MenuItem>
            </Menu>
          </div>
        </div>
        <div className="price-tag">
          <a href="#" className="justifyText">
            <p>
              <b>OFERTAS </b>
            </p>
            <i class="ri-price-tag-3-fill"></i>
          </a>
        </div>
      </div>
    </div>
  );
};
export default Navigation;
